package com.xzx.xzxms.inquiry.service.impl;import com.xzx.xzxms.inquiry.dao.extend.InquiryPoolExtendMapper;import com.xzx.xzxms.inquiry.service.IInquiryPoolService;import com.xzx.xzxms.inquiry.bean.InquiryPool;import org.springframework.stereotype.Service;import javax.annotation.Resource;import java.util.List;@Servicepublic class InquiryPoolServiceImpl implements IInquiryPoolService {    @Resource    private InquiryPoolExtendMapper inquiryPoolExtendMapper;    @Override    public List<InquiryPool> findByParams(String name, String brand, Long proDetailId, String model) {        return inquiryPoolExtendMapper.findByParams(name, brand, proDetailId, model);    }}